import React from 'react';


const UserList = ({ users, onItemClick }) => {

  return (

    <ul className="list-group">
     {users.map(user => (
        <li key={user.id} className="list-group-item d-flex align-items-center" onClick={() => onItemClick(user)}>
          <a href={`/users/${user.username}`} className="d-flex align-items-center">
            <img src={user.avatarUrl} alt={user.username} className="rounded-circle mr-2" />
            <span>{user.username}</span>
          </a>
        </li>
      ))}
    </ul>
  );
};


export default UserList;
